sub
fieldFormat
{
    my $precision = "";

    my @prec = split(/\|/, $fields[0]);
    for (my $i = 0; $i < @prec; $i++)
    {
        my $len;
         if ($prec[$i] =~  (/\d+\.(\d+)/))
        {
                $len = length($1);
        }
        else
        {
            $len = "0";
        }
        $precision .= ($i ? "|" : "") . $len;
    }
    return($precision);
}

