sub
fieldFormat
{
    my @numeric = ();
    my @unit = ();
    my $max = @fields;
    my $marker = chr(1);

    if ($max > 0 && $fields[0] ne "")
    {
        @numeric = split(/$marker/, $fields[0]);
    }
    if ($max > 1 && $fields[1] ne "")
    {
        @unit = split(/$marker/, $fields[1]);
    }
    $max = @numeric;
    if (@unit > $max)
    {
        $max = @unit;
    }
    my @values = ();
    for (my $i = 0; $i < $max; $i++)
    {
        my $uncert = "";

        if (defined($numeric[$i]))
        {
                $uncert .= $numeric[$i];
        }
        if (defined($unit[$i]))
        {
                $uncert .= $unit[$i];
        }
        if ($uncert ne "")
        {
                push(@values, $uncert);
        }
    }
    return(join("|", @values));
}

